import React, { useState, useEffect }  from 'react';
import axios from "axios";
const Home = () => {
    //const[initialData, setInitialData] =useState([{}])
    const[currentTopTen, setCurrentTopTen] = useState([{}])
    const[currentTrendingTen, setCurrentTrendingTen] = useState([{}])
    const[pastTopTen, setPastCurrentTopTen] = useState([{}])
    const[pastTrendingTen, setPastTrendingTen] = useState([{}])
    const [isLoaded, setIsLoaded] = useState(false);

    useEffect (() => {
        fetch('/getAllPastMovies').then(
            response => response.json()
        ).then(pastMovieData => {
            setIsLoaded(true);
            setCurrentTopTen(pastMovieData);
            console.log(pastMovieData);
        },[])

        fetch('/getAllPastTrendingMovies').then(
            response => response.json()
        ).then(pastTrendingData =>console.log(pastTrendingData))

        fetch('/topTenTrendingMoviesNow').then(
            response => response.json()
        ).then(currentTrendingData =>console.log(currentTrendingData))

        fetch('/topTenMoviesNow').then(
            response => response.json()
        ).then(currentMovieData =>console.log(currentMovieData))
    })

    }



export default Home;
